files.patch:
@@ -1085,8 +1085,8 @@ fix = {
  */
 fix = {
     hackname  = bsd_stdio_attrs_conflict;
-    mach      = *-*-*bsd*;
-    mach      = *-*-*darwin*;
+    mach      = "*-*-*bsd*";
+    mach      = "*-*-*darwin*";
     files     = stdio.h;
     select    = "^#define[ \t]*vfscanf[ \t]*__svfscanf[ \t]*$";
     c_fix     = format;
@@ -1303,7 +1303,7 @@ fix = {
  */
 fix = {
     hackname  = freebsd_gcc3_breakage;
-    mach      = *-*-freebsd*;
+    mach      = "*-*-freebsd*";
     files     = sys/cdefs.h;
     select    = '^#if __GNUC__ == 2 && __GNUC_MINOR__ >= 7$';
     bypass    = '__GNUC__[ \t]*([>=]=[ \t]*[3-9]|>[ \t]*2)';
@@ -1320,7 +1320,7 @@ fix = {
  */
 fix = {
     hackname  = freebsd_gcc4_breakage;
-    mach      = *-*-freebsd*; 
+    mach      = "*-*-freebsd*"; 
     files     = sys/cdefs.h;
     select    = '^#if __GNUC__ == 2 && __GNUC_MINOR__ >= 7 \|\| __GNUC__ == 3$';
     c_fix     = format;
@@ -1602,7 +1602,7 @@ fix = {

 fix = {
      hackname  = hppa_hpux_fp_macros;
-     mach      = hppa*-hp-hpux11*;
+     mach      = "hppa*-hp-hpux11*";
      files     = math.h;
      select    = "#[ \t]*define[ \t]*FP_NORMAL.*\n"
 		 "#[ \t]*define[ \t]*FP_ZERO.*\n"
@@ -1711,7 +1711,7 @@ fix = {
  */
 fix = {
     hackname  = hpux11_abs;
-    mach      = ia64-hp-hpux11*;
+    mach      = "ia64-hp-hpux11*";
     files     = stdlib.h;
     select    = "ifndef _MATH_INCLUDED";
     c_fix     = format;
@@ -2653,7 +2653,7 @@ fix = {
  */
 fix = {
     hackname  = netbsd_c99_inline_1;
-    mach      = *-*-netbsd*;
+    mach      = "*-*-netbsd*";
     files     = signal.h;
     select    = "extern __inline int";

@@ -2666,7 +2666,7 @@ fix = {

 fix = {
     hackname  = netbsd_c99_inline_2;
-    mach      = *-*-netbsd*;
+    mach      = "*-*-netbsd*";
     files     = signal.h;
     select    = "#define _SIGINLINE extern __inline";

@@ -2688,7 +2688,7 @@ fix = {
  */
 fix = {
     hackname  = netbsd_extra_semicolon;
-    mach      = *-*-netbsd*;
+    mach      = "*-*-netbsd*";
     files     = sys/cdefs.h;
     select    = "#define[ \t]*__END_DECLS[ \t]*};";
